    "2015-01-22T15:57:30.213964",nt"name": "challenge-grantees",nt"isopen":
    false,nt"url": null,nt"notes": "HUD's Community Challenge Grants aim to
    reform and reduce barriers to achieving affordable, economically vital and sustainable
    communities. The funds are awarded to communities, large and small, to address local
    challenges to integrating transportation and housing. Such efforts may include amending
    or updating local master plans, zoning codes, and building codes to support private
    sector investment in mixed-use development, affordable housing and the re-use of
    older buildings. Other local efforts may include retrofitting main streets to provide
    safer routes for children and seniors, or preserving affordable housing and local
    businesses near new transit stations.",nt"license_title": "License Not Specified",nt"extras":
